import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 10, height: 10, viewBox: "0 0 10 10", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M5 10A5 5 0 105 0a5 5 0 000 10zm0-7v1.8l1.35 1.35a.5.5 0 11-.7.7l-1.5-1.5A.5.5 0 014 5V3a.5.5 0 011 0z", fill: primaryFill }));
};
const PresenceAway10Filled = wrapIcon(rawSvg({}), 'PresenceAway10Filled');
export default PresenceAway10Filled;
